import Stack from '@material-ui/core/Stack';
import Box from '@material-ui/core/Box';
import background from '../../resources/images/brot3.png';
import { styled } from '@material-ui/core/styles';
import useWindowDimensions from '../../components/ui/Window.js';
import theme from "../../components/ui/Theme.js"

const SuccessSlider = styled(Box)(({ theme }) => ({
    mt: 1000,
    width: '100%',
    backgroundColor: theme.palette.success.main
}));

function StudentViewPage() {
    const { height } = useWindowDimensions();
    console.log(height);

    return (
        <div style={{ backgroundImage: `url(${background})` }}>
            <Stack spacing={8}>
                <SuccessSlider style={{ height: height }} sx={{mt: 100}}/>
                <SuccessSlider style={{ height: height }} />
                <SuccessSlider style={{ height: height }} />
                <SuccessSlider style={{ height: height }} />
                <SuccessSlider style={{ height: height }} />
            </Stack>
        </div>

    )
}

export default StudentViewPage;
